import React from 'react';
import del from '../../../img/delete.png'
import edit from '../../../img/edit.png'

function Goal(props) {
    return (
        <div>
            {props.goal.name}
            <button>
                <img src={edit} alt=""/>
                <img src={del} alt=""/>
            </button>
        </div>
    );
}

export default Goal;
